const puzzleInput = "";
let puzzleInputWithoutLetter;

function removePolymer(letter) {
	puzzleInputWithoutLetter = puzzleInput.split("");
	for(let i = 0; i < puzzleInputWithoutLetter.length; i++) {
		if (puzzleInputWithoutLetter[i] === letter || 
			puzzleInputWithoutLetter[i].toLowerCase() === letter ||
			puzzleInputWithoutLetter[i].toUpperCase() === letter) {
			puzzleInputWithoutLetter.splice(i,1);
		}
	}
}


function findMatches() {

	let amountRemoved = 0;

	for(let  i = 0; i < puzzleInputWithoutLetter.length - 1; i++) {
	    if (isOpposite(puzzleInputWithoutLetter[i], puzzleInputWithoutLetter[i+1])) {
	        puzzleInputWithoutLetter.splice(i,2);
	        amountRemoved += 2;
	    }
	}

	return amountRemoved;
}

function isOpposite(f, s) {
    if (f === s) {
        return false;
    }

    if (f.toLowerCase() === s ||
            f.toUpperCase() === s ||
            f === s.toLowerCase() ||
            f === s.toUpperCase()) {
        return true;
    }


    return false;
}


for(let i = 0; i < 26; i++) {

	let letter = (i+10).toString(36);
	let minimumLength = Number.MAX_SAFE_INTEGER;

	removePolymer(letter);
	let removed = findMatches();
	while (removed !== 0) {
		 removed = findMatches();
	}

	minimumLength = puzzleInputWithoutLetter.length < minimumLength ? puzzleInputWithoutLetter.length : minimumLength;

}